import Post from "./components/Post";
import Header from "./components/Header";
import { Routes, Route } from "react-router-dom";
function App() {
  return (
    <Routes>
      <Route
        index
        element={
          <main className="p-10 w-[700px] m-auto">
            <Header />
            <Post />
            <Post />
            <Post />
          </main>
        }
      ></Route>
      <Route path={'/login'} element={<div>Lgoin Page</div>}></Route>
    </Routes>
  );
}

export default App;
